  <body>

    <div id="brax-viewer"></div>

    <script type="module">
      import {Viewer} from 'viewer';
      import * as THREE from 'three';

      const domElement = document.getElementById("brax-viewer");
      var viewer = new Viewer(domElement, system);

      viewer.camera.position.set(0, 10, 1);  // Set the camera's initial position
      viewer.controls.target.set(0, 0, 0);   // Set the camera's target

      // Set follow distance to 10 m
      viewer.camera.followDistance = 10;

      viewer.animate = function() {
        requestAnimationFrame(() => this.animate());
        this.animator.update();

        const targetPos = new THREE.Vector3();
        this.target.getWorldPosition(targetPos);

        if (this.camera.follow) {
          this.controls.target.lerp(targetPos, 0.1);
          const direction = this.camera.position.clone().sub(this.controls.target).normalize();
          const desiredPosition = this.controls.target.clone().add(direction.multiplyScalar(this.camera.followDistance));
          this.camera.position.lerp(desiredPosition, 0.1);
          this.setDirty();
        }

        this.dirLight.position.set(targetPos.x + 3, targetPos.y + 10, targetPos.z + 10);
        this.dirLight.target = this.target;

        if (this.controls.update()) {
          this.setDirty();
        }

        if (this.camera.freezeAngle) {
          const off = new THREE.Vector3();
          off.add(this.controls.target).sub(this.controlTargetPos);
          off.setComponent(1, 0);
          if (off.lengthSq() > 0) {
            this.camera.position.add(off);
            this.setDirty();
          }
        }
        this.controlTargetPos.copy(this.controls.target);

        if (this.needsRender) {
          this.render();
        }
      };

      // Set default for freezeAngle to true
      viewer.camera.freezeAngle = true;

      // Set default for contactDebug to false
      viewer.contactDebug = false;

      // Ensure the pelvis is selected by default
      viewer.scene.traverse((child) => {
      if (child.name === 'torso') {
        child.selected = true;
        viewer.target = child;
        viewer.setDirty();
      }
      });
    </script>

  </body>

</html>
